import React from 'react'
import Card from './Card'

function botonLink(props){
    return(
        <div>
            {   props.link.map((links) =>   {
                     return(
                                <Card                       
                                   
                                    img = {links.img}
                                
                                />
                            )
                    })
                }
        </div>
    )

}

export default botonLink
